 import React from 'react';
 import { NavLink, useNavigate } from "react-router-dom";
 import logo from '../logoAdmin.png';
 import { useDispatch, useSelector } from 'react-redux';
 import { LogOut, reset } from '../features/authSlice';

 const Navbar = () => {
     const dispatch = useDispatch();
     const navigate = useNavigate();
     const { user } = useSelector((state) => state.auth);

     const logout = () => {
         dispatch(LogOut());
         dispatch(reset());
         navigate('/');
     };

     return (
         <div>
             <nav className="navbar is-fixed-top has-background-white" role="navigation" aria-label="main navigation">
                 <div className="navbar-brand">
                     {user.role !== 2 && (
                         <NavLink to="/dashboard" className="navbar-item has-background-white custom-navbar">
                             <img
                                 src={logo}
                                 width="112"
                                 height="28"
                                 alt='logo'
                             />
                         </NavLink>
                     )}

                     <a href='!#' role="button" className="navbar-burger burger " aria-label="menu" aria-expanded="false" data-target="navbarBasicExample">
                         <span aria-hidden="true"></span>
                         <span aria-hidden="true"></span>
                         <span aria-hidden="true"></span>
                     </a>
                 </div>

                 <div id="navbarBasicExample" className="navbar-menu has-background-white">

                     <div className="navbar-end has-background-white">
                         <div className="navbar-item">
                             <div className="buttons">
                                 <button onClick={logout} className="button is-light">
                                     Cerrar Sesión
                                 </button>
                             </div>
                         </div>
                     </div>
                 </div>
             </nav>
         </div>
     )
 }

 export default Navbar;
